define('widgets/wemo_crockpot/js/model',['Cache'],
    /** @exports model class and instantiated model */
    function(Backbone) {

        'use strict';

        var mockPath = 'widgets/wemo_crockpot/mocks/';

        var Model = Backbone.WemoDeviceModel.extend({
            /**
             * default data values
             */
            defaults: {
                'mode': 0,
                'time': 0,
                'startTime': 0,
                'cookTime': 0,
                'cookedTime': 0,
                'elapsedTime': 0,
                'defaultFriendlyName': '',
                "defaultIcon": "file:///android_asset/www/img/new_icons/CrockPot_SlowCooker_@3x.png"
            },
            /**
             * validation fields, uses Backbone.validation
             */
            validation: {
                'mode': {
                    required: true
                },
                'time': {
                    required: true
                },
                'friendlyName': {
                    required: true
                },
                'cookedTime': {
                    required: true
                }
            },
//            /**
//             * runs once when the model is instantiated
//             */
//            initialize: function() {
//                this.on('change:time', this.checkTime);
//            },
            checkTime: function() {
                var time = parseInt(this.get('time'), 10);

                if (time > 1425) {
                    this.set('time', 0);
                }
            },
            /**
             * array of different values for the mode field, for power cycle step through
             */
            modeArray: [0, 52, 51, 50],
            /* modes to step through on power cycle */
            /**
             *   set the native command
             */
            setCommand: 'SetCrockpotState',
            /**
             *  set the native get command
             */
            getCommand: 'GetCrockpotState',
            /**
             * parses the response when remote call is made, for instances like when remote returns status, but it is actually equivalent to mode
             * @param resp {JSON}
             * @returns {JSON}
             */
            mapToLocal: function(resp) {
                if (resp.status) {
                    resp.mode = resp.status;
                    resp.time = resp.eventDuration;
                }
                DEBUG && console.error("resp.mode: " + resp.mode + " invalid. Changing to 50");
                if (resp.mode == "54") {
                    resp.mode = "50";
                }
                return resp;
            },
            /**
             * checks to ensure that response has acceptable values, otherwise triggers a sync error.
             * @param  {JSON} resp data coming into the model through the parse method.
             */
            validateResponse: function() {
                var isValid = true;
                DEBUG && console.log('CROCKPOT:MODEL:checkCapabilities');
                var mode = parseInt(this.get('mode'), 10);
                var foundMode = _.indexOf(this.modeArray, mode);
                DEBUG && console.log('CROCKPOT:MODEL:checkCapabilities:mode=' + mode + ':foundMode=' + foundMode);
                if (foundMode === -1) {
                    isValid = false;
                }
                DEBUG && console.log('CROCKPOT:MODEL:checkCapabilities:isValid=' + isValid);
                return isValid;
            },
            /**
             * converts local variables to cloud variables when request is sent, because of course they don't match.
             * @param  {JSON} resp
             * @return {JSON} resp
             */
            mapToRemote: function(resp) {
                resp.status = resp.mode;
                resp.eventDuration = resp.time;

                delete resp.mode;
                delete resp.time;

                return resp;
            },
            /**
             * urls, statusUrl, and rulesUrl all allow dummy data to be loaded for demo/test
             * @returns {string}
             */
            url: function() {
                return mockPath + 'device.json';
            },
            statusUrl: function() {
                return mockPath + 'data.json';
            },
            rulesUrl: function() {
                return mockPath + 'rules.json';
            },
            remoteStatusUrl: function() {
                return mockPath + 'status.xml';
            }
        });

        return {
            Model: Model,
            model: new Model() //we need to pass a shared model, but we want the base object available for unit testing
        };
    });
