define('extensions/ui/powerButton', ['backbone'], function(Backbone) {

    'use strict';


    var PowerButton = Backbone.View.extend({
        events: {
        },

        initialize: function(options) {
            _.extend(this, options);
            this.isRendered = false;
            this._state = -1;
        },

        setState: function(state){
            if(state === this._state) return;

            var self = this;
            var _setState = function(){
                self.$('.powerState').attr('class', 'powerState powerState-' + state);
                self._state = state;
            };

            _setState(state);
        },

        render: function(){
            if(!this.isRendered){
                this.$el.html('<div class="powerState powerState-0" data-bind="modeIcon" aria-live="polite" aria-atomic="true" role="button"><div class="powerStateSpinner"></div></div>');
                this.$('.powerState').on('click', this.onTap);
                this.isRendered = true;
            }
        }
    });

    PowerButton.MODE = {
        MODE_OFF: 0,
        MODE_ON: 1,
        MODE_SEARCHING: 2
    };

    return PowerButton;

});

define('widgets/wemo_crockpot/js/tile',['backbone', 'hbs!widgets/wemo_crockpot/templates/tile', 'extensions/ui/powerButton'],
    /** @exports tile view */
    function(Backbone, template, PowerButton) {

        'use strict';

        //will store the settings for when we start cycling the power button.

        var View = Backbone.TileBaseView.extend({
            template: template,

            /**
             * adds event binding to elements, clicks are converted to pointerup events
             */
            events: {
            },
            /**
             * two-way data binding to models, uses Backbone.stickit
             */
            bindings: {
                '*[data-bind="friendlyName"]': {
                    observe: 'friendlyName',
                    updateMethod: 'html',
                    onGet: function(value) {
                        var name = value;
                        if (value == null || value == "")
                            name = this.i18n("defaultFriendlyName");
                        name = (name.match('Â')) ? name.replace('Â', '') : name;
                        return name;
                    }
                },
                '*[data-bind="status"]': {
                    observe: ['mode' , 'cookedTime' , 'time'],
                    onGet: function(values) {
                        var statusStr = '',
                            mode = parseInt(values, 10);
                        var cookedTime = parseInt(values[1], 10),
                            time = parseInt(values[2], 10);

                        if (time > 1425) {
                            this.model.set('time', 0);
                            time = 0;
                        }

                        if (mode === 0) {
                            statusStr = this.i18n('mode', mode);
                        } else if (time > 0) {
                            this.sandbox.isTimerSet = true;
                            if (mode === 50) {
                                //isWarmUI
                                statusStr = this.i18n('labels', 'warmTimeLeft') + ': ' + this.sandbox.util.secondsToHoursAndMinutesStr(time * 60);
                            } else {
                                statusStr = this.i18n('labels', 'remaining') + ': ' + this.sandbox.util.secondsToHoursAndMinutesStr(time * 60);
                            }
                        } else {
                            //notTimerSetUI
                            this.sandbox.isTimerSet = false;
                            this.sandbox.emit('changeView', 'staysafe');
                            if (cookedTime < 1) {
                                if (mode === 50) {
                                    statusStr = this.i18n('labels', 'onWarm');
                                } else if (mode === 51) {
                                    statusStr = this.i18n('labels', 'onLow');
                                } else if (mode === 52) {
                                    statusStr = this.i18n('labels', 'onHigh');
                                }
                            } else {
                                this.hasTimerFinished = false;
                                statusStr = this.i18n('labels', 'onFor') + ' ' + this.sandbox.util.secondsToHoursAndMinutesStr(cookedTime * 60);
                            }
                        }
                        return statusStr;
                    }
                }
            },
            settingsModel: new Backbone.Model(),
            /**
             * put non-DOM event listeners here. These need to be removed when no longer necessary to free up memory (this.stopListening())
             */
            listen: function() {
                /** add your own here **/
                this.listenTo(this.model, 'change', this.changePowerButtonUI);
                this.listenTo(this.model, 'syncFromSubscription', this.checkSubscriptionChanges);
                this.listenTo(this.model, 'change:friendlyName', this.setCorrectBrandCharacter);
            },
            checkSubscriptionChanges: function(previousModel) {
                var mode = parseInt(this.model.get('mode'), 10);
                var time = parseInt(this.model.get('time'), 10);
                DEBUG && console.log('TILE:checkSubscriptionChanges:isTimerSet=' + this.sandbox.isTimerSet + ':hasTimerFinished=' + this.hasTimerFinished);
                if (this.sandbox.isTimerSet && mode === 50 && (time === 0 || time === 360) && this.hasTimerFinished) {
                    //this.endTimer(parseInt(previousModel.get('mode'), 10));
                }
            },
            /**
             * is called whenever the model changes
             */
            change: function() {
                this.changePowerButtonUI();
            },
            endTimer: function(mode) {
                this.sandbox.emit('mealReady', true);

                var self = this;

                DEBUG && console.log('TIMER:TILE:endTimer:currentMode=' + mode);

                this.confirmDialog = new this.sandbox.dom.Alert({
                    title: self.i18n('tile', 'finishedTitle'),
                    message: self.i18n('tile', 'finishedMessage'),
                    buttonLabels: self.i18n('buttons','ok')
                });
            },
            /**
             * is called whenever a fetch completes, to handle the incoming data
             */
            sync: function() {
                this.change();
                this.isManualSet = false; //set to false here... timer is changed after sync, when model.notifyUserEvent completes. Full sync should override any other settings
            },
            /**
             * set up the dom elements we need to change in the ui functions
             */
            render: function() {
                this.$counterFor = this.$('.countUp .for');
                this.renderPowerButton();
                this.changePowerButtonUI();
                this.delegateEvents();
                this.setCorrectBrandCharacter();
            },
            renderPowerButton: function(){
                this.powerButton = new PowerButton({
                    $el: this.$('.power'),
                    onTap: this.setSlowCooker.bind(this)
                });
                this.powerButton.render();
            },
            afterSave: function() {
                /* doing actual save from 2 second delay? */
                if (this.isSaving) {
                    this.model.preserveState();
                    this.isSaving = false;
                    this.changePowerButtonUI();
                }
            },
            /**
             * callback for when a save fails
             */
            failSave: function() {
                var self = this;
                this.isSaving = false;
                this.isManualSet = false;
                this.confirmDialog = new this.sandbox.dom.Alert({
                    title: self.i18n('tile', 'failedTitle'),
                    message: self.i18n('tile', 'failedMessage'),
                    buttonLabels: self.i18n('buttons','ok')
                });

                this.$('.css-spinner').removeClass("fadeIn");
                this.model.undo();
            },
            /**
             * sets up the button to show/hide drawer cross-platform
             */
            afterInitialize: function() {
                var element = this.$('.description');
                this.sandbox.uiInterface.setShowHideDrawer.call(this, element);
            },
            /**
             * ui logic to make changes to the slow cooker values
             */
            setSlowCooker: function() {
                var self = this;
                var timeout = 2000;
                var mode = parseInt(this.model.get('mode'), 10);
                var newMode;
                var modeArray = this.model.modeArray;

                var cookTime = parseInt(this.model.get('cookTime'), 10);
                var time = parseInt(this.model.get('time'), 10);
                var cookedTime = parseInt(this.model.get('cookedTime'), 10);

                //set time to zero when timer has finished. Cancel the timer going from warm to any other setting.
                if (this.hasTimerFinished) {
                    time = 0;
                }
                // console.log('SAVING:' + self.isSaving)
                if (!self.isSaving) {

                    if (!this.isSetting) {

                        this.settingsModel.set({
                            cookTime: cookTime,
                            time: time,
                            cookedTime: cookedTime
                        });

                        this.model.preserveState();
                        DEBUG && console.log('FAILED: preserving state:' + JSON.stringify(this.model.attributes));
                        this.isSetting = true;
                    }

                    if (!this.isManualSet) { //set the mode when we start changing. will only unset when we save or dont save.
                        this.isManualSet = mode;
                    }

                    modeArray.forEach(function(num, index) {
                        if (mode === num) {
                            newMode = modeArray[(index + 1)];
                            if (!newMode) {
                                newMode = modeArray[0];
                            }
                            return true;
                        }
                    });

                    var attributes = {
                        mode: newMode
                    };

                    if (newMode === 0) {
                        _.extend(attributes, {
                            time: 0,
                            cookedTime: 0,
                            cookTime: 0
                        });
                    } else {
                        _.extend(attributes, this.settingsModel.attributes);
                    }

                    if (this.sandbox.isTimerSet) {
                        this.model.set(attributes);
                        this.model.preSave(['mode', 'time', 'cookTime', 'cookedTime']);
                        timeout = 2000;
                    } else {
                        timeout = 100;
                    }

                    // this.$('.countUp').hide();
                    clearTimeout(this.timer);
                    this.timer = setTimeout(function() {
                        if (self.hasTimerFinished) {
                            self.hasTimerFinished = false;
                            self.sandbox.isTimerSet = false;
                        }
                        self.isSaving = true;
                        self.isSetting = false;

                        self.model.set(attributes);
                        self.model.save(['mode', 'time', 'cookTime', 'cookedTime']).fail(self.failSave);
                    }, 100);
                }
            },
            changePowerButtonUI: function() {
                var mode = parseInt(this.model.get('mode'), 10);

                if (!this.isSaving) {
                    this.powerButton.setState(mode);
                    if (mode > 49) {
                        this.$('.countUp').show();
                        this.$('.mode').hide();
                    } else if (mode < 49) {
                        this.$('.countUp').hide();
                        this.$('.mode').show();
                        if (mode === 0) {
                            this.$('.mode').hide();
                        }
                    }
                }

            }
        });

        return View;
    });

